import React from "react";
import "../boosted/css/boosted.min.css";
import axios from "axios";

function CreateInvitation() {
  return (
    <div>
      <h1>Welcome To Soverify Solution</h1>
        <button onClick={()=>{
            var config = {
                method :'post',
                url :'http://localhost:8021/connections/create-invitation',
                data:JSON.stringify({
                    "mediation_id": "3fa85f64-5717-4562-b3fc-2c963f66afa6",
                    "metadata": {},
                    "my_label": "Bob",
                    "recipient_keys": [
                      "H3C2AVvLMv6gmMNam3uVAjZpfkcJCwDwnZn6z3wXmqPV"
                    ],
                    "routing_keys": [
                      "H3C2AVvLMv6gmMNam3uVAjZpfkcJCwDwnZn6z3wXmqPV"
                    ],
                    "service_endpoint": "http://192.168.56.102:8020"
                  })
            }
            axios(config).then(function (response) {
                console.log(response)
            })
        }}>Create Invitation</button>
    </div>
  );
}

export default CreateInvitation;
